import React from 'react';
import { Route, Switch } from 'react-router-dom'

import Navbar from './Navbar'
import PokeDex from './PokeDex';
import Pokemon from './Pokemon';

function App() {
  return (
    <Switch>
     <Route 
     exact 
     path="/" 
     render={(props) => <PokeDex {...props} /> 
     }/>
     <Route 
      exact
      path="/:pokemonId "
      render={(props) => <Pokemon {...props} /> 
      }/>
    </Switch>

  )
}

export default App;
